wol (){
   for i in $WRLDZ;do
      for a in $(cat $1);do
         /usr/bin/wol -i $i $a
      done
   done
}
xk_mpty (){
   test "$MNAM" = "htk.sh" && test -z $SRC && SRC=inst
}
hyperf_cluster_control_commands (){
   case $MNAM in
      h.attach_to_screens)
         attach_to_screens
      ;;
      h.copy_ids)
         noisy_mode_loop_run copy_ids
      ;;
      n.hyper_deploy)
         noisy_mode_loop_run hyper_deploy
      ;;
      n.hyper_exec)
         noisy_mode_loop_run hyper_exec
      ;;
      n.hyper_get)
         FNM=$(basename $SRC)
         mkdir $HGDR
         noisy_mode_loop_run hyper_get
      ;;
      n.hyper_sync)
         noisy_mode_loop_run hyper_sync
      ;;
      h.id_flush)
         clear
         echo "Deletes $USR ssh keys from $MLST."
         echo "Type EXCT to continue."
         read EXCT
         case $EXCT in
            EXCT)
               noisy_mode_loop_run id_flush
            ;;
            *)
               echo "exiting..."
               exit
            ;;
         esac
      ;;
      h.key_parallel_copy)
         SCREENCOUNT=0
         noisy_mode_loop_run key_parallel_copy
         SCREENCOUNT=0
         key_open_screens
      ;;
      h.populate_known_hosts)
         pop_kwn_hst
      ;;
      h.populate_known_hosts_slow)
         pop_kwn_hst $SRC
      ;;
      n.serial_deploy)
         noisy_mode_loop_run serial_deploy
      ;;
      n.tab_exec)
         table_mode_loop_run serial_exec
      ;;
      n.serial_exec)
         noisy_mode_loop_run serial_exec
      ;;
      n.serial_get)
         FNM=$(basename $SRC)
         mkdir $HGDR
         noisy_mode_loop_run serial_get
      ;;
      n.serial_sync)
         noisy_mode_loop_run serial_sync
      ;;
      n.remote_exec)
         noisy_mode_loop_run remote_exec
      ;;
      h.scan_lan)
         scn_ln
      ;;
      n.unique_get)
         mkdir $HGDR
         noisy_mode_loop_run unique_get
      ;;
      h.wol)
         wol $SRC
      ;;
      h.xosview)
         xovmon
      ;;
      htk.sh)
         case $CMD_LN in
            *)
               htk_install
            ;;
         esac
      ;;
      s.copy_ids)
         slprn copy_ids
      ;;
      s.hyper_deploy)
         slprn hyper_deploy
      ;;
      s.hyper_exec)
         slprn hyper_exec
      ;;
      s.hyper_get)
         FNM=$(basename $SRC)
         mkdir $HGDR
         slprn hyper_get
      ;;
      s.hyper_sync)
         slprn hyper_sync
      ;;
      s.serial_deploy)
         slprn serial_deploy
      ;;
      s.serial_exec)
         slprn serial_exec
      ;;
      s.serial_get)
         FNM=$(basename $SRC)
         mkdir $HGDR
         slprn serial_get
      ;;
      s.serial_sync)
         noisy_mode_loop_run serial_sync
      ;;
      s.remote_exec)
         slprn remote_exec
      ;;
      s.unique_get)
         mkdir $HGDR
         slprn unique_get
      ;;
      x.serial_exec)
         TCMD="$TCMD -X"
         noisy_mode_loop_run serial_exec
      ;;
      x.hyper_exec)
         TCMD="$TCMD -X"
         noisy_mode_loop_run hyper_exec
      ;;
      x.remote_exec)
         TCMD="$TCMD -X"
         noisy_mode_loop_run remote_exec
      ;;
      *)
         echo nothing to do     exiting ...
      ;;
   esac
}
xlprn (){
   GLOBIGNORE=*
   GEOX=0
   GEOY=0
   for i in $(cat $MLST);do
      echo $i
      $1
      GEOX=$(($GEOX+100))
      GEOY=$(($GEOY+100))
   done
   unset GLOBIGNORE
}
xovcmdz (){
   screen -S $i -d -m $XCMD $i xosview -geometry +$GEOX+$GEOY
}
xovmon (){
   clear
   echo "   ======="
   echo "   WARNING"
   echo "   ======="
   echo
   echo "   xosview IS RAM-INTENSIVE ON THIS MACHINE!"
   echo
   echo "Are you sure you want to run it on EVERY MACHINE IN THE LIST? [y/n]"
   echo
   echo -n "[n]  "
   THSBL=n
   read THSBL
   cON
   case $THSBL in 
      y*|sure|ok|do\ it*|go*) xlprn xovcmdz ;;
      *) exit ;;
   esac
   cOFF
}
x_p_cmd (){
   screen -S $i -d -m $XCMD $i $CMD_LN -geometry +$GEOX+$GEOY
}
yolk_2_stdout (){
   # Extracts a yolkified payload from another file
   # Takes 2 args:      1 is unique yolk (payload) name suffix
   #                    2 is name of file to extract yolk from
   if [ $# -ne 2 ] ; then
      echo "Wrong number of arguments."
      echo "You must provide a yolk suffix name and file to extract from."
      return 33
   fi
   tail -n+$(($(grep -no "^#BEGIN_YOLK_${1}" $2 | cut -d":" -f1)+1)) $2 | \
      head -n-1 | openssl base64 -d
}

#main---------------------------------------------------------------------------
defcon htk.conf $@
process_htk_mgmt_options $@
xk_mpty
# NOTE: The script exits prior to the Cluster Control Commands if a management
#       option was given before it makes it to this point.
hyperf_cluster_control_commands
exit

